import React from 'react'

import './previewCollection.scss'

const CollectionPreview =({title, item})=>(
    <div>
    <h1>{title}</h1>
    <div>
    {item.map(item =>(
        <div>{item.name}</div>
    ))}
    </div>
    </div>
)

export default CollectionPreview
